import React from 'react'

const InfoForm = () => {
    return(
        <div className='w-2/3 h-screen relative inset-x-center-section bg-athens-gray'>
            <div className='flex flex-col items-center w-2/3 h-full relative inset-x-center-section bg-white py-20 select-none'>
                <h1 className='text-4xl font-extrabold text-prussian-blue'>Application form</h1>
                <input className='w-1/2'></input>
            </div>
        </div>
    )
}

export default InfoForm;
